import React from "react";
import "./Home.css";

const navItems = [
  "NEWS",
  "StudyGuides",
  "Subject Prescription",
  "B.S Access",
  "Public",
  "Student",
  "Staff",
  "Profile",
  "Academic Report",
  "Tests",
  "Misc",
  "Attendance",
  "Lecture Assessments",
  "Vlabs",
  "Qualifications",
  "Subject List",
];

function Home() {
  return (
    <div className="home-container">
      <h1>Electronic Campus</h1>
      <nav className="navbar">
        <ul className="navbar-list">
          {navItems.map((item) => (
            <li key={item} className="navbar-item">
              <a
                href={`#${item.replace(/\s+/g, "").toLowerCase()}`}
                className="navbar-link"
              >
                {item}
              </a>
            </li>
          ))}
        </ul>
      </nav>
      {/* Add your page content here */}
    </div>
  );
}

export default Home;
